import React, { Component } from "react";

class ModalReact extends Component {
    
    test2 = () => {
        console.log("Hello1")
        return(
            <div className="container">
                <div className="body">
                    <h4> This is the Test Modal Layout</h4>
                </div>
            </div>
        )
    }

    render() {
        return (
            <button onClick={this.test2}> Modal React</button>
        );
    }
}

export default ModalReact;
